(483, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:42:\"Elementor Sites of the Month – May 2020 \";s:7:\"excerpt\";s:71:\"Here are our top picks of Elementor sites for May 2020. Check them out!\";s:7:\"created\";s:10:\"1591783220\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/showcase-may-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:49:\"Introducing Multi-Step Form and Lottie Animations\";s:7:\"excerpt\";s:119:\"We’re thrilled to introduce two new amazing features to Elementor Pro v2.10: Multi Step Forms and the Lottie widget. \";s:7:\"created\";s:10:\"1591712820\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:127:\"https://elementor.com/blog/introducing-multi-step-form/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:42:\"How to Migrate from Shopify to WooCommerce\";s:7:\"excerpt\";s:252:\"Wondering if you should move from Shopify to WooCommerce? In this article, we will discuss the advantages of using WooCommerce for your online store, and explain step-by-step how to make the transition from Shopify to WooCommerce in two different ways.\";s:7:\"created\";s:10:\"1591085572\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/shopify-to-woocommerce/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:56:\"8 Best WordPress Security Plugins to Lock Down Your Site\";s:7:\"excerpt\";s:261:\"Security plugins are a crucial part of your website or your clients website protection. To help you choose the best WordPress security plugin for your needs, we\'ve collected 8 great options that can help with security hardening, firewalls, and malware scanning.\";s:7:\"created\";s:10:\"1590569303\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:125:\"https://elementor.com/blog/wordpress-security-plugin/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";